John Zorn and Yamataka Eye - Naninani II (2004)




Naninani II is an album of improvised music by American composer and saxophonist/multi-instrumentalist John Zorn and Yamataka Eye. It is a sequel to their previous album Nani Nani which was released in 1994, which is presently on the tracker. 

Track listing

All compositions by John Zorn and Yamataka Eye

    &quot;Fuckxotica&quot; - 4:18
    &quot;Hilo Himo&quot; - 3:14
    &quot;Shiso Baba&quot; - 8:24
    &quot;UFOFF&quot; - 7:34
    &quot;Bar Time with Eno&quot; - 3:44
    &quot;Kiri Taki&quot; - 3:44
    &quot;4AB&quot; - 1:54
    &quot;Fat Anarchy on Airtube&quot; - 9:37
    &quot;Espimo&quot; - 2:12
    &quot;Macabro Delicato&quot; - 2:13

Personnel

    Yamataka Eye: Voice, Electronics, Organ, Banjo, Steel Guitar, Electric Fan, Objects, Percussion
    John Zorn: Alto Saxophone, Piano, Tabla Machine, Tibetan Bells, Percussion
